column5:
@selina_todd @bindelj Selina, I heard your fantastic speech at the Oxford meeting of @Womans_Place_UK The hysterical reaction to the event from people who did not attend is beyond ridiculous.
I hope @UniofOxford are doing everything possible to keep you safe.
Solidarity.

@RossCameron4 @BorisJohnson @UniofOxford Pretty certain we don't need any more right wing rags telling us that we need a "debate" and certainly not one that looks back to the 1600s for inspiration.
Science is not about debate. It is about data.
The only real doubt is just how quickly we get to the point of no return.

@RossCameron4 @BorisJohnson @UniofOxford "science" has been tested and shown to be accurate.
The current chaotic weather systems all around the planet were demonstrated by the modeling of "science".
Only thing they got wrong was the time scale &amp; degree, both understated in large part because of denier considerations.

@OxUniMaths We will be asking for #feedback from visitors on whether they notice the #ecolabel as well as their thoughts on the #design and content. 

If you're in #Oxford please come speak to one of our on-site researchers during the pilot study period (4th - 21st Feb.) 

@UniofOxford
